package scraper

import (
	"context"
	"github.com/cockroachdb/errors"
	"github.com/spf13/cobra"
	"github.com/spf13/viper"
	mongoadapter "go.impalastudios.com/aviation/liveflights/internal/adapters/mongodb"
	radarboxtcp "go.impalastudios.com/aviation/liveflights/internal/adapters/radarbox_tcp"
	"go.impalastudios.com/aviation/liveflights/internal/core"
	"go.impalastudios.com/aviation/liveflights/pkg/xmongodb"
	"go.impalastudios.com/grpc/dnssrvresolver"
	"go.impalastudios.com/log"
	xotel "go.impalastudios.com/otel"
	"go.opentelemetry.io/otel"
	"go.opentelemetry.io/otel/propagation"
	"go.uber.org/zap"
	"google.golang.org/grpc/resolver"
	"os"
	"os/signal"
	"time"
)

// New creates a new scrape command
func New() *cobra.Command {
	cmd := &cobra.Command{
		Use:   "scrape",
		Short: "Scrape radarbox data and persist",
		Long:  "Scrapes radarbox data through TCP client and persists the data in a database",
		PreRunE: func(cmd *cobra.Command, args []string) error {
			return viper.BindPFlags(cmd.Flags())
		},
		RunE: runScrape,
	}

	cmd.PersistentFlags().String("radarbox.host", "", "Radarbox TCP host")
	cmd.PersistentFlags().String("radarbox.ssh.host", "", "Radarbox SSH host")
	cmd.PersistentFlags().String("radarbox.ssh.private-key", "", "Radarbox SSH private key")
	cmd.PersistentFlags().String("radarbox.ssh.user", "impala", "Radarbox SSH user")

	cmd.PersistentFlags().Duration("services.scraper.batch_store_interval", 5*time.Minute, "The duration between each flush of scraped batches of data.")

	return cmd
}

type scrapeConfig struct {
	App struct {
		Name string `mapstructure:"name"`
		Key  string `mapstructure:"key"`
	} `mapstructure:"app"`
	Logging struct {
		Debug    bool   `mapstructure:"debug"`
		Encoding string `mapstructure:"encoding"`
	} `mapstructure:"logging"`
	RadarBox radarboxtcp.Config `mapstructure:"radarbox"`
	Mongo    xmongodb.Config    `mapstructure:"mongodb"`
	Services struct {
		Scraper struct {
			BatchStoreInterval time.Duration `mapstructure:"batch_store_interval"`
		} `mapstructure:"scraper"`
	} `mapstructure:"services"`
}

func runScrape(cmd *cobra.Command, _ []string) error {
	var cfg scrapeConfig
	if err := viper.Unmarshal(&cfg); err != nil {
		return errors.Wrap(err, "failed to unmarshal config")
	}

	logger := log.New(
		log.WithService(viper.GetString("app.name")),
		log.WithEncoding(viper.GetString("logging.encoding")),
		log.WithDebugEnabled(viper.GetBool("logging.debug")),
	)
	log.SetLogger(logger)

	ctx := cmd.Context()

	// Make connections
	resolver.Register(dnssrvresolver.New())

	// Tracing
	tp, err := xotel.NewTracerProvider(cmd.Context(), xotel.TracerProviderConfig{
		ServiceName: cfg.App.Name,
		Endpoint:    viper.GetString("otel.tracer.endpoint"),
	})
	if err != nil {
		return errors.Wrap(err, "failed to create tracer provider")
	}

	otel.SetTracerProvider(tp)
	otel.SetTextMapPropagator(propagation.NewCompositeTextMapPropagator(propagation.TraceContext{}, propagation.Baggage{}))
	xotel.SetGlobalTracer(tp.Tracer("go.impalastudios.com/otel"))

	mp, err := xotel.NewMeterProvider(cmd.Context(), xotel.MeterProviderConfig{
		ServiceName: cfg.App.Name,
		Endpoint:    viper.GetString("otel.meter.endpoint"),
		Interval:    viper.GetDuration("otel.meter.interval"),
	})
	if err != nil {
		return errors.Wrap(err, "failed to create meter provider")
	}

	otel.SetMeterProvider(mp)
	xotel.SetGlobalMeter(mp.Meter("go.impalastudios.com/otel"))

	// Database
	db, err := xmongodb.Connect(ctx, cfg.Mongo)
	if err != nil {
		return errors.Wrap(err, "failed to connect to mongodb")
	}

	if err := xmongodb.Migrate(ctx, cfg.Mongo.DB, db.Client); err != nil {
		return errors.Wrap(err, "failed to migrate mongodb")
	}

	database := db.Database(cfg.Mongo.DB)
	flightsUpdateRepo := mongoadapter.NewFlightsUpdateRepository(database)

	// External provider
	client := radarboxtcp.New(cfg.RadarBox)
	if err := client.Connect(ctx); err != nil {
		return err
	}
	defer func() { _ = client.Close() }()

	// Service
	svc := core.NewFlightsIngestService(
		flightsUpdateRepo,
		client,
		cfg.Services.Scraper.BatchStoreInterval,
	)

	quit := make(chan os.Signal, 1)

	signal.Notify(quit, os.Interrupt)

	log.Info(ctx, "Starting to consume flight updates")

	ctx, cancel := context.WithCancel(ctx)
	defer cancel()

	go func() {
		if err := svc.ConsumeFlightUpdates(ctx); err != nil {
			log.Error(ctx, "Failed to consume flight updates", zap.Error(err))
			cancel()
		}
	}()

	select {
	case <-ctx.Done():
		log.Info(ctx, "Context done, terminating the realtime live flights service")
	case <-quit:
		log.Info(ctx, "Received interrupt signal, terminating the realtime live flights service")
	}

	return nil
}

package data_processor

import (
	"context"
	"github.com/aws/aws-sdk-go-v2/service/s3"
	"github.com/cockroachdb/errors"
	"github.com/spf13/cobra"
	"github.com/spf13/viper"
	adapters "go.impalastudios.com/aviation/liveflights/internal/adapters"
	adapterscache "go.impalastudios.com/aviation/liveflights/internal/adapters/cache"
