	return cmd
}

package core

import (
	"context"
	"github.com/cockroachdb/errors"
)

//go:generate mockgen -source=service.go -destination=mocks/service_mocks.go -package=mocks
type liveFlightsRepository interface {
	Filter(context.Context, *FlightsWithin) ([]*LiveFlight, error)
	GetFlightDetailsByLiveFlightID(context.Context, string) (*LiveFlight, error)
	GetFlightDetailsByFlightID(context.Context, string) (*LiveFlight, error)
}

type filesystemLiveFlightsRepository interface {
	GetLiveFlight(context.Context, string) (*LiveFlight, error)
	SaveLiveFlight(context.Context, string, *LiveFlight) error
}

type Service struct {
	repo liveFlightsRepository
	fs   filesystemLiveFlightsRepository
}

func NewService(repo liveFlightsRepository, fs filesystemLiveFlightsRepository) *Service {
	return &Service{
		repo: repo,
		fs:   fs,
	}
}

