}

func NewFlightArchiveService(
	archives flightArchivesRepository,
	filesystem filesystemLiveFlightsRepository,
	archivePageSize int,
	maxArchiveCycles int,
) *FlightArchiveService {
	if archivePageSize <= 0 {
		archivePageSize = 100
	}
	if maxArchiveCycles <= 0 {
		maxArchiveCycles = 1
	}
	return &FlightArchiveService{
