	}
)

type ingestMetrics struct {
	totalBatches  int
	totalUpdates  int
	totalDuration time.Duration
	lastReport    time.Time
}

type FlightsIngestService struct {
	flightUpdatesRepo           flightUpdatesRepository
	realtimeFlightUpdatesClient realtimeFlightUpdatesClient

	batchStoreInterval time.Duration

	metrics ingestMetrics
}

func NewFlightsIngestService(
	flightUpdatesRepository flightUpdatesRepository,
	realtimeFlightUpdatesClient realtimeFlightUpdatesClient,
	batchStoreInterval time.Duration,
) *FlightsIngestService {
	return &FlightsIngestService{
		flightUpdatesRepo:           flightUpdatesRepository,
		realtimeFlightUpdatesClient: realtimeFlightUpdatesClient,
		batchStoreInterval:          batchStoreInterval,
		metrics: ingestMetrics{
			lastReport: time.Now().Add(-5 * time.Minute),
		},
	}
}

// ConsumeFlightUpdates consumes flight updates from the realtime flight updates client
func (s *FlightsIngestService) ConsumeFlightUpdates(ctx context.Context) error {
	subscriber := make(chan LiveFlightUpdate)

	realtimeFlightDataStreamErr := make(chan error)

	go func() {
		if err := s.realtimeFlightUpdatesClient.Read(ctx, subscriber); err != nil {
			realtimeFlightDataStreamErr <- err
		}
	}()

	uniqueFlightUpdates := make(map[string]LiveFlightUpdate)
	ticker := time.NewTicker(s.batchStoreInterval)

	for {
		select {
		case flightupdate := <-subscriber:
			uniqueFlightUpdates[flightupdate.ID] = flightupdate
		case <-ticker.C:
			s.insertBatchFlightUpdates(ctx, uniqueFlightUpdates)
			clear(uniqueFlightUpdates)
		case <-ctx.Done():
			log.Info(ctx, "Shutting down the flight updates service...")
			return nil
		case err := <-realtimeFlightDataStreamErr:
			log.Error(ctx, "Realtime data stream raised an error unexpectedly", zap.Error(err))
			return err
		}
	}
}

func (s *FlightsIngestService) insertBatchFlightUpdates(ctx context.Context, uniqueUpdates map[string]LiveFlightUpdate) {
	if len(uniqueUpdates) == 0 {
		log.Debug(ctx, "There are no flight updates to store")
		return
	}

	flightUpdatesBatch := make([]*LiveFlightUpdate, 0, len(uniqueUpdates))

	for _, update := range uniqueUpdates {
		flightUpdatesBatch = append(flightUpdatesBatch, &update)
	}

	start := time.Now()
	err := s.flightUpdatesRepo.UpsertMany(ctx, flightUpdatesBatch)
	dur := time.Since(start)

	if err != nil {
		log.Error(ctx, "Failed to insert batch records of realtime flight updates",
			zap.Error(err),
			zap.Int("count", len(flightUpdatesBatch)),
		)

		return
	}

	s.metrics.totalBatches++
	s.metrics.totalUpdates += len(flightUpdatesBatch)
	s.metrics.totalDuration += dur

	s.logMetricsIfNeeded(ctx)
}

func (s *FlightsIngestService) logMetricsIfNeeded(ctx context.Context) {
	now := time.Now()
	if now.Sub(s.metrics.lastReport) < 5*time.Minute {
		return
	}

	var avgBatchDur time.Duration
	var avgUpdatesPerBatch float64

	if s.metrics.totalBatches > 0 {
		avgBatchDur = s.metrics.totalDuration / time.Duration(s.metrics.totalBatches)
		avgUpdatesPerBatch = float64(s.metrics.totalUpdates) / float64(s.metrics.totalBatches)
	}

	log.Debug(ctx, "Ingest metrics report",
		zap.Int("batches", s.metrics.totalBatches),
		zap.Int("total_updates", s.metrics.totalUpdates),
		zap.Duration("avg_batch_duration", avgBatchDur),
		zap.Float64("avg_updates_per_batch", avgUpdatesPerBatch),
	)

	s.metrics = ingestMetrics{lastReport: now}
}

