func (s *FlightsEnrichService) Enrich(ctx context.Context) error {
	s.metrics.totalCalls++

	for i := 0; i < s.maxEnrichCycles; i++ {
		flights, err := s.enrichRepo.GetUnenrichedFlights(ctx, s.enrichPageSize)
		if err != nil {
			log.Error(ctx, "Failed to retrieve unenriched flights", zap.Error(err))
			s.metrics.totalFailed++
			s.logMetricsIfNeeded(ctx)
			return err
		}
		if len(flights) == 0 {
			break
		}

		var enriched []*EnrichedFlightData
		for _, flight := range flights {
			data := s.buildEnrichedFlightData(ctx, flight)
			if data != nil {
				enriched = append(enriched, data)
				s.metrics.totalEnriched++

				if data.FlightID == nil {
					s.metrics.missingFlightID++
				}
			} else {
				s.metrics.totalSkipped++
			}
		}

		if len(enriched) > 0 {
			if err := s.enrichRepo.EnrichFlights(ctx, enriched); err != nil {
				log.Error(ctx, "Failed to bulk enrich flights", zap.Error(err))
				s.metrics.totalFailed++
				s.logMetricsIfNeeded(ctx)
				return err
			}
		}
	}

	s.logMetricsIfNeeded(ctx)
	return nil
}

func (s *FlightsEnrichService) buildEnrichedFlightData(ctx context.Context, flight *LiveFlight) *EnrichedFlightData {
	const defaultClassification = 5

	data := &EnrichedFlightData{
		LiveFlightID:   flight.ID,
		Classification: defaultClassification,
	}

	if flight.AirlineDesignator != "" {
		airline, err := s.airlines.GetByDesignator(ctx, flight.AirlineDesignator)
		if err != nil {
			s.metrics.airlineNotFound[flight.AirlineDesignator]++
		} else if airline != nil {
			data.Classification = int64(airline.Classification)
		}
	}

	var departureCode string
	if flight.DepartureAirportICAO != "" || flight.DepartureAirportIATA != "" {
		departure, err := s.airports.GetByICAOOrIATA(
			ctx,
			optionalString(flight.DepartureAirportICAO),
			optionalString(flight.DepartureAirportIATA),
		)
		if err != nil {
			key := flight.DepartureAirportICAO + "/" + flight.DepartureAirportIATA
			s.metrics.departureAirportNotFound[key]++
		} else if departure != nil {
			departureCode = departure.Designator
		}
	}

	var arrivalCode string
	if flight.ArrivalAirportICAO != "" || flight.ArrivalAirportIATA != "" {
		arrival, err := s.airports.GetByICAOOrIATA(
			ctx,
			optionalString(flight.ArrivalAirportICAO),
			optionalString(flight.ArrivalAirportIATA),
		)

		if err != nil {
			key := flight.ArrivalAirportICAO + "/" + flight.ArrivalAirportIATA
			s.metrics.arrivalAirportNotFound[key]++
		} else if arrival != nil {
			arrivalCode = arrival.Designator
		}
	}

	if !flight.DepartureTime.IsZero() && flight.FlightNumber != "" &&
		flight.AirlineDesignator != "" && departureCode != "" && arrivalCode != "" {

		//TODO: FlightID logic
		flightID := fmt.Sprintf(
			"%s_%s_%s_%s_%s",
			flight.DepartureTime.Format("20060102"),
			flight.AirlineDesignator,
			flight.FlightNumber,
			departureCode,
			arrivalCode,
		)
		data.FlightID = &flightID
	}

	return data
}

func optionalString(s string) *string {
	if s == "" {
		return nil
	}
	return &s
}

func (s *FlightsEnrichService) logMetricsIfNeeded(ctx context.Context) {
	now := time.Now()
	if now.Sub(s.metrics.lastReport) < 5*time.Minute {
		return
	}

	log.Debug(ctx, "Flights enrich metrics (last 5 min)",
		zap.Int("calls", s.metrics.totalCalls),
		zap.Int("enriched", s.metrics.totalEnriched),
		zap.Int("failed", s.metrics.totalFailed),
		zap.Int("skipped", s.metrics.totalSkipped),
		zap.Int("missing_flight_id", s.metrics.missingFlightID),
	)

	type pair struct {
		key   string
		count int
	}
	explain := func(data map[string]int) (distinct int, top10 []string) {
		distinct = len(data)

		pairs := make([]pair, 0, distinct)
		for k, v := range data {
			pairs = append(pairs, pair{k, v})
		}

		sort.Slice(pairs, func(i, j int) bool {
			return pairs[i].count > pairs[j].count
		})

		n := 10
		if len(pairs) < n {
			n = len(pairs)
		}
		top10 = make([]string, 0, n)
		for i := 0; i < n; i++ {
			top10 = append(top10, fmt.Sprintf("%s(%d)", pairs[i].key, pairs[i].count))
		}
		return
	}

	aDistinct, aTop := explain(s.metrics.airlineNotFound)
	if aDistinct > 0 {
		log.Debug(ctx, "Airlines not found summary",
			zap.Int("distinct_airlines_not_found_count", aDistinct),
			zap.Strings("top_airlines_not_found", aTop),
		)
	}

	dDistinct, dTop := explain(s.metrics.departureAirportNotFound)
	if dDistinct > 0 {
		log.Debug(ctx, "Departure airports not found summary",
			zap.Int("distinct_departures_not_found_count", dDistinct),
			zap.Strings("top_departures_not_found", dTop),
		)
	}

	rDistinct, rTop := explain(s.metrics.arrivalAirportNotFound)
	if rDistinct > 0 {
		log.Debug(ctx, "Arrival airports not found summary",
			zap.Int("distinct_arrivals_not_found_count", rDistinct),
			zap.Strings("top_arrivals_not_found", rTop),
		)
	}

	s.metrics = enrichMetrics{
		airlineNotFound:          make(map[string]int),
		departureAirportNotFound: make(map[string]int),
		arrivalAirportNotFound:   make(map[string]int),
		lastReport:               now,
	}
}

