func coordinateFromPoint(p *geoJSON) core.Coordinate {
	if p.Type != "Point" {
		return core.Coordinate{}
	}
	coords := p.Coordinates
	if len(coords) != 2 {
		return core.Coordinate{}
	}
	lon, ok := coords[0].(float64)
	if !ok {
		return core.Coordinate{}
	}
	lat, ok := coords[1].(float64)
	if !ok {
		return core.Coordinate{}
	}
	return core.Coordinate{
		Lon: lon,
		Lat: lat,
	}
}

