func (r *FlightsEnrichRepository) GetUnenrichedFlights(ctx context.Context, limit int) ([]*core.LiveFlight, error) {
	ctx, span := xotel.Tracer.Start(ctx, "FlightsEnrichRepository:GetUnenrichedFlights", trace.WithSpanKind(trace.SpanKindClient))
	defer span.End()

