	if err != nil {
		span.RecordError(err)
		span.SetStatus(codes.Error, err.Error())

		return nil, errors.Wrap(err, "mongo: failed to find unenriched flights")
	}
	defer func() { _ = cursor.Close(ctx) }()

	var raw []liveFlight
	if err := cursor.All(ctx, &raw); err != nil {
		span.RecordError(err)
		span.SetStatus(codes.Error, err.Error())

		return nil, errors.Wrap(err, "mongo: failed to decode unenriched flights")
	}

