		}

		writemodels = append(writemodels, &mongo.UpdateOneModel{
			Filter: bson.M{"live_flight_id": e.LiveFlightID},
			Update: bson.M{"$set": set},
		})

		if len(writemodels) == enrichSatchSize || i == len(enriched)-1 {
			_, err := r.coll.BulkWrite(ctx, writemodels, options.BulkWrite().SetOrdered(false))
			if err != nil && !errors.Is(err, mongo.ErrUnacknowledgedWrite) {
				span.RecordError(err)
				span.SetStatus(codes.Error, err.Error())

				return errors.Wrap(err, "mongo: failed to enrich flights in bulk")
			}
			writemodels = writemodels[:0]
		}
	}

	return nil
}

