// FlightsArchiveRepository handles archiving live flights and their tracks.
type FlightsArchiveRepository struct {
	flightsColl *mongo.Collection
	tracksColl  *mongo.Collection
}

const ttl = 24 * time.Hour

// NewFlightsArchiveRepository creates a repository for flight_updates and flight_tracks
func NewFlightsArchiveRepository(db *mongo.Database) *FlightsArchiveRepository {
	return &FlightsArchiveRepository{
		flightsColl: db.Collection(
			"flight_updates",
			options.Collection().SetReadConcern(&readconcern.ReadConcern{Level: readconcern.Local().Level}),
		),
		tracksColl: db.Collection(
			"flight_tracks",
		),
	}
}

// GetArchivableFlights retrieves flights whose TTL has expired, including their tracks
func (r *FlightsArchiveRepository) GetArchivableFlights(ctx context.Context, limit int) ([]*core.LiveFlight, error) {
	ctx, span := xotel.Tracer.Start(ctx, "FlightsArchiveRepository:GetArchivableFlights", trace.WithSpanKind(trace.SpanKindClient))
	defer span.End()

	span.SetAttributes(
		attribute.Int("limit", limit),
	)

	cutoff := time.Now().UTC().Add(-ttl)
	filter := bson.M{"created_at": bson.M{"$lte": cutoff}}

	findOpts := options.Find().SetLimit(int64(limit))
	cursor, err := r.flightsColl.Find(ctx, filter, findOpts)
	if err != nil {
		span.RecordError(err)
		span.SetStatus(codes.Error, err.Error())

		return nil, errors.Wrap(err, "mongo: failed to find live flights")
	}
	defer func() {
		_ = cursor.Close(ctx)
	}()

	var docs []liveFlight
	if err := cursor.All(ctx, &docs); err != nil {
		span.RecordError(err)
		span.SetStatus(codes.Error, err.Error())

		return nil, errors.Wrap(err, "mongo: failed to decode live flights")
	}

	flights := make([]*core.LiveFlight, len(docs))
	ids := make([]string, len(docs))
	for i, d := range docs {
		flights[i] = d.toDomain()
		ids[i] = d.ID
	}

	trackCursor, err := r.tracksColl.Find(ctx, bson.M{"live_flight_id": bson.M{"$in": ids}})
	if err != nil {
		span.RecordError(err)
		span.SetStatus(codes.Error, err.Error())

		return nil, errors.Wrap(err, "mongo: failed to find flight tracks")
	}
	defer func() {
		_ = trackCursor.Close(ctx)
	}()

	var tps []trackPoint
	if err := trackCursor.All(ctx, &tps); err != nil {
		span.RecordError(err)
		span.SetStatus(codes.Error, err.Error())

		return nil, errors.Wrap(err, "mongo: failed to decode flight tracks")
	}

	tracksMap := make(map[string][]core.TrackPoint, len(docs))
	for _, tp := range tps {
		tracksMap[tp.LiveFlightID] = append(tracksMap[tp.LiveFlightID], tp.toDomain())
	}

	for _, f := range flights {
		if pts, ok := tracksMap[f.ID]; ok {
			f.Tracks = pts
		}
	}

	return flights, nil
}

// DeleteFlights removes flights and their associated tracks in a single operation
func (r *FlightsArchiveRepository) DeleteFlights(ctx context.Context, flights []*core.LiveFlight) error {
	ctx, span := xotel.Tracer.Start(ctx, "FlightsArchiveRepository:DeleteFlights", trace.WithSpanKind(trace.SpanKindClient))
	defer span.End()

	ids := flightIDs(flights)

	span.SetAttributes(
		attribute.StringSlice("ids", ids),
	)

	filter := bson.M{"live_flight_id": bson.M{"$in": ids}}

	if _, err := r.flightsColl.DeleteMany(ctx, filter); err != nil {
		span.RecordError(err)
		span.SetStatus(codes.Error, err.Error())

		return errors.Wrap(err, "mongo: failed to delete flight updates")
	}

	if _, err := r.tracksColl.DeleteMany(ctx, filter); err != nil {
		span.RecordError(err)
		span.SetStatus(codes.Error, err.Error())

		return errors.Wrap(err, "mongo: failed to delete flight tracks")
	}

	return nil
}

// flightIDs extracts live_flight_id values
func flightIDs(flights []*core.LiveFlight) []string {
	ids := make([]string, len(flights))
	for i, f := range flights {
		ids[i] = f.ID
	}
	return ids
}

