func (r *FlightsUpdateRepository) UpsertMany(ctx context.Context, updates []*core.LiveFlightUpdate) error {
	ctx, span := xotel.Tracer.Start(ctx, "FlightsUpdateRepository:UpsertMany", trace.WithSpanKind(trace.SpanKindClient))
	defer span.End()
	span.SetAttributes(attribute.Int("updates", len(updates)))

	if len(updates) == 0 {
		return nil
	}

	const (
		chunk        = 1250
		workers      = 4
		bulkTimeout  = 15 * time.Second
		retryBackoff = 250 * time.Millisecond
	)

	type job struct{ start, end int }
	jobs := make(chan job, (len(updates)+chunk-1)/chunk)

	bwo := options.BulkWrite().
		SetOrdered(false).
		SetBypassDocumentValidation(true)

	var wg sync.WaitGroup
	var mu sync.Mutex
	var firstErr error

	setFirstErr := func(err error) {
		if err == nil {
			return
		}
		mu.Lock()
		if firstErr == nil {
			firstErr = err
		}
		mu.Unlock()
	}

	isTransientWrite := func(err error) bool {
		if err == nil {
			return false
		}
		msg := err.Error()
		return strings.Contains(msg, "i/o timeout") ||
			strings.Contains(msg, "context deadline exceeded") ||
			strings.Contains(msg, "unable to write wire message")
	}

	doBulk := func(parent context.Context, coll *mongo.Collection, models []mongo.WriteModel) error {
		attempt := func() error {
			bctx, cancel := context.WithTimeout(parent, bulkTimeout)
			_, err := coll.BulkWrite(bctx, models, bwo)
			cancel()
			if errors.Is(err, mongo.ErrUnacknowledgedWrite) {
				return nil
			}
			return err
		}

		if err := attempt(); err != nil {
			if isTransientWrite(err) {
				time.Sleep(retryBackoff)
				return attempt()
			}
			return err
		}
		return nil
	}

	worker := func() {
		defer wg.Done()
		for j := range jobs {
			u := updates[j.start:j.end]

			flights := make([]mongo.WriteModel, 0, len(u))
			tracks := make([]mongo.WriteModel, 0, len(u))

			for _, x := range u {
				flights = append(flights, mongo.NewUpdateOneModel().
					SetUpsert(true).
					SetFilter(bson.M{"live_flight_id": x.ID}).
					SetUpdate(bson.M{
						"$setOnInsert": toInsertLiveFlight(x),
						"$set":         toUpdateLiveFlight(x),
					}),
				)
				tracks = append(tracks, mongo.NewInsertOneModel().
					SetDocument(toTrackPointInsert(x)))
			}

			// SEQUENTIAL per chunk to cut socket pressure
			if err := doBulk(ctx, r.flightsColl, flights); err != nil {
				setFirstErr(err)
				return
			}
			if err := doBulk(ctx, r.tracksColl, tracks); err != nil {
				setFirstErr(err)
				return
			}
		}
	}

	for i := 0; i < workers; i++ {
		wg.Add(1)
		go worker()
	}

	for i := 0; i < len(updates); i += chunk {
		end := i + chunk
		if end > len(updates) {
			end = len(updates)
		}
		jobs <- job{start: i, end: end}
	}
	close(jobs)
	wg.Wait()

	if firstErr != nil {
		span.RecordError(firstErr)
		span.SetStatus(codes.Error, firstErr.Error())
		log.Error(ctx, "Failed bulk upsert for live flights/tracks", zap.Error(firstErr))
		return firstErr
	}

	return nil
}

func firstNonNil(errs ...error) error {
	for _, e := range errs {
		if e != nil {
			return e
		}
	}
	return nil
}

