// Filter returns a page of live flights within the bounding BoundingBox
func (r *FlightsUpdateRepository) Filter(ctx context.Context, f *core.FlightsWithin) ([]*core.LiveFlight, error) {
	ctx, span := xotel.Tracer.Start(ctx, "FlightsUpdateRepository:Filter", trace.WithSpanKind(trace.SpanKindClient))
	defer span.End()

	span.SetAttributes(
		attribute.Float64("bounding_box_top_left_lat", f.BoundingBox.TopLeft.Lat),
		attribute.Float64("bounding_box_top_left_lon", f.BoundingBox.TopLeft.Lon),
		attribute.Float64("bounding_box_bottom_right_lat", f.BoundingBox.BottomRight.Lat),
		attribute.Float64("bounding_box_bottom_right_lon", f.BoundingBox.BottomRight.Lon),
		attribute.String("max_age", f.MaxAge.String()),
	)

	if f.AirlineClassification != nil {
		span.SetAttributes(
			attribute.Int("airline_classification_c", int(f.AirlineClassification.C)),
			attribute.Int("airline_classification_comparator", int(f.AirlineClassification.Comparator)),
		)
	}

	filter := bson.M{
		"position": bson.M{
			"$geoWithin": bson.M{
				"$geometry": polygonFromBoundingBox(f.BoundingBox),
			},
		},
	}

	if f.MaxAge > 0 {
		cutoff := time.Now().UTC().Add(-f.MaxAge)
		filter["updated_at"] = bson.M{"$gte": cutoff}
	}

	if f.AirlineClassification != nil && f.AirlineClassification.C > 0 {
		op := r.claimOperationFromClassificationComparator(f.AirlineClassification.Comparator)
		filter["airline_classification"] = bson.M{op: f.AirlineClassification.C}
	}

	findOpts := options.Find().
		SetProjection(bson.M{
			"live_flight_id":    1,
			"flight_id":         1,
			"position":          1,
			"altitude":          1,
			"heading_direction": 1,
		})

	cursor, err := r.flightsColl.Find(ctx, filter, findOpts)
	if err != nil {
		span.RecordError(err)
		span.SetStatus(codes.Error, err.Error())

		return nil, errors.Wrap(err, "mongo: failed to find live flights")
	}
	defer func() {
		_ = cursor.Close(ctx)
	}()

	var fs []liveFlight
	if err := cursor.All(ctx, &fs); err != nil {
		span.RecordError(err)
		span.SetStatus(codes.Error, err.Error())

		return nil, errors.Wrap(err, "mongo: failed to decode live flights")
	}

	fsd := make([]*core.LiveFlight, len(fs))
	for i, f := range fs {
		coord := coordinateFromPoint(&f.Position)

		fsd[i] = &core.LiveFlight{
			ID:               f.ID,
			FlightID:         f.FlightID,
			Position:         coord,
			Altitude:         f.Altitude,
			HeadingDirection: f.HeadingDirection,
		}
	}

	return fsd, nil
}

func polygonFromBoundingBox(bb *core.BoundingBox) primitive.M {
	return primitive.M{
		"type": "Polygon",
		"coordinates": []any{
			[][]float64{
				{bb.TopLeft.Lon, bb.BottomRight.Lat},     // bottom-left (min_lon, min_lat)
				{bb.BottomRight.Lon, bb.BottomRight.Lat}, // bottom-right (max_lon, min_lat)
				{bb.BottomRight.Lon, bb.TopLeft.Lat},     // top-right (max_long, max_lat)
				{bb.TopLeft.Lon, bb.TopLeft.Lat},         // top-left (min_lon, max_lat)
				{bb.TopLeft.Lon, bb.BottomRight.Lat},     // Closing the polygon
			},
		},
	}
}

func (r *FlightsUpdateRepository) claimOperationFromClassificationComparator(comparator core.ClassificationComparator) string {
	switch comparator {
	case core.ClassificationGreaterComparator:
		return "$lte"
	case core.ClassificationLesserComparator:
		return "$gte"
	default:
		return "$eq"
	}
}

