func (r *FlightsUpdateRepository) getFlightByFilter(ctx context.Context, filter bson.M) (*core.LiveFlight, error) {
	ctx, span := xotel.Tracer.Start(ctx, "FlightsUpdateRepository:getFlightByFilter", trace.WithSpanKind(trace.SpanKindClient))
	defer span.End()

	var lf liveFlight
	if err := r.flightsColl.FindOne(ctx, filter).Decode(&lf); err != nil {
		span.RecordError(err)
		span.SetStatus(codes.Error, err.Error())

		if errors.Is(err, mongo.ErrNoDocuments) {
			return nil, core.ErrFlightNotFound
		}
		return nil, errors.Wrap(err, "mongo: failed to find flight")
	}
	lfd := lf.toDomain()

	cursor, err := r.tracksColl.Find(ctx, bson.M{"live_flight_id": lfd.ID})
	if err != nil {
		span.RecordError(err)
		span.SetStatus(codes.Error, err.Error())

		return nil, errors.Wrap(err, "mongo: failed to find flight tracks")
	}
	defer func() {
		_ = cursor.Close(ctx)
	}()

	var rawTracks []trackPoint
	if err := cursor.All(ctx, &rawTracks); err != nil {
		span.RecordError(err)
		span.SetStatus(codes.Error, err.Error())

		return nil, errors.Wrap(err, "mongo: failed to decode flight tracks")
	}

	// Convert and attach tracks
	lfd.Tracks = make([]core.TrackPoint, len(rawTracks))
	for i, tp := range rawTracks {
		lfd.Tracks[i] = tp.toDomain()
	}

	return lfd, nil
}

func (r *RealtimeFlightData) HasLiveFlightID() bool {
	return r.AirlineIataCode != "" && r.FlightNumber != "" && r.OriginAirportIataCode != "" && r.DestinationAirportIataCode != "" && r.DepartureScheduledLocalTime != ""
}

func (r *RealtimeFlightData) getLiveFlightID() string {
	departureTime, err := time.Parse(localTimeLayout, r.DepartureScheduledLocalTime)
	if err != nil {
		log.Error(context.TODO(), "Failed to parse departure time", zap.Error(err))
	}

	airlineDesignator := r.FlightNumber[:2]
	flightNumber := r.FlightNumber[2:]

	return fmt.Sprintf(
		"%s_%s_%s_%s_%s",
		departureTime.Format("20060102"),
		airlineDesignator,
		flightNumber,
		r.OriginAirportIataCode,
		r.DestinationAirportIataCode,
	)
}

func (r *RealtimeFlightData) getAirlineDesignator() string {
	return r.FlightNumber[:2]
}

func (r *RealtimeFlightData) getFlightNumber() string {
	return r.FlightNumber[2:]
}

const localTimeLayout = "2006-01-02 15:04:05"

func (r *RealtimeFlightData) toDomain() core.LiveFlightUpdate {
	at, err := time.Parse(localTimeLayout, r.Timestamp)
	if err != nil {
		log.Error(context.TODO(), "Failed to parse timestamp", zap.Error(err))
	}

	departureTime, err := time.Parse(localTimeLayout, r.DepartureScheduledLocalTime)
	if err != nil {
		log.Error(context.TODO(), "Failed to parse departue timestamp", zap.Error(err))
	}

	return core.LiveFlightUpdate{
		ID:                   r.getLiveFlightID(),
		FlightNumber:         r.getFlightNumber(),
		AirlineDesignator:    r.getAirlineDesignator(),
		DepartureTime:        departureTime,
		DepartureAirportICAO: r.OriginAirportIcaoCode,
		DepartureAirportIATA: r.OriginAirportIataCode,
		ArrivalAirportICAO:   r.DestinationAirportIcaoCode,
		ArrivalAirportIATA:   r.DestinationAirportIataCode,
		Position: core.Coordinate{
			Lat: r.Lat,
			Lon: r.Lon,
		},
		Altitude:         r.Altitude,
		HeadingDirection: r.HeadingDirection,
		GroundSpeed:      r.GroundSpeed,
		VerticalSpeed:    r.VerticalSpeed,
		Squawk:           r.Squawk,
		CreatedAt:        at,
	}
}

package radarboxtcp

import (
	"bufio"
	"compress/zlib"
	"context"
	"encoding/json"
	"net"
	"regexp"
	"strings"
	"time"

	"github.com/cockroachdb/errors"
	"go.impalastudios.com/aviation/liveflights/internal/core"
	"go.impalastudios.com/log"
	"go.uber.org/zap"
	"golang.org/x/crypto/ssh"
)

type Config struct {
	Host string `mapstructure:"host"`
	SSH  SSH    `mapstructure:"ssh"`
}

type SSH struct {
	Host       string `mapstructure:"host"`
	PrivateKey string `mapstructure:"private-key"`
	User       string `mapstructure:"user"`
}

type Client struct {
	cfg           Config
	sshc          *ssh.Client
	conn          net.Conn
	metrics       *metrics
	numberOfReads int
}

const (
	bufSize         = 64 * 1024
	initialBackoff  = 1 * time.Second
	maxBackoffDelay = 5 * time.Minute
	metricsInterval = 5 * time.Minute
	rotateAfterMsgs = 50000
)

func New(cfg Config) *Client {
	return &Client{
		cfg:     cfg,
		metrics: newMetrics(metricsInterval),
	}
}

// Connect ensures SSH exists and (re)opens the inner TCP channel.
func (c *Client) Connect(ctx context.Context) error {
	if c.sshc == nil {
		signer, err := ssh.ParsePrivateKey([]byte(c.cfg.SSH.PrivateKey))
		if err != nil {
			return errors.Wrap(err, "failed to parse private key")
		}
		sshclient, err := ssh.Dial("tcp", c.cfg.SSH.Host, &ssh.ClientConfig{
			User:              c.cfg.SSH.User,
			Auth:              []ssh.AuthMethod{ssh.PublicKeys(signer)},
			HostKeyCallback:   ssh.InsecureIgnoreHostKey(),
			HostKeyAlgorithms: []string{signer.PublicKey().Type()},
		})
		if err != nil {
			return errors.Wrap(err, "failed to dial through ssh")
		}
		c.sshc = sshclient
	}

	conn, err := c.sshc.Dial("tcp", c.cfg.Host)
	if err != nil {
		c.metrics.incrementSSHReset()
		_ = c.sshc.Close()
		c.sshc = nil
		return errors.Wrap(err, "failed to dial tcp over ssh")
	}

	c.conn = conn
	c.numberOfReads = 0
	return nil
}

// Read keeps the stream alive, with capped exponential backoff and SSH-reset metrics.
// Rules:
//   - Create ONE zlib reader per TCP connection; reuse it for many lines.
//   - After each successful line read, increment numberOfReads; if >= rotateAfterMsgs, rotate the connection.
//   - Any read/zlib error (including EOF) closes and reconnects.
func (c *Client) Read(ctx context.Context, subscriber chan<- core.LiveFlightUpdate) error {
	defer func() {
		if c.conn != nil {
			_ = c.conn.Close()
		}
		if c.sshc != nil {
			_ = c.sshc.Close()
		}
	}()

	backoff := initialBackoff
	attempt := 1

	for {
		select {
		case <-ctx.Done():
			log.Info(ctx, "Context done, terminating radarbox tcp reader")
			return nil
		default:
		}

		c.metrics.logIfNeeded(ctx)

		// Connect (or reconnect) if needed
		if c.conn == nil {
			if err := c.Connect(ctx); err != nil {
				log.Error(ctx, "Failed to reconnect to radarbox tcp server",
					zap.Int("attempt", attempt), zap.Error(err),
				)
				attempt++
				time.Sleep(backoff)
				backoff *= 2
				if backoff > maxBackoffDelay {
					backoff = maxBackoffDelay
				}
				continue
			}

			c.metrics.recordSuccessfulConnect()
			backoff = initialBackoff
			attempt = 1
		}

		// Create ONE zlib reader for this TCP connection
		zr, err := zlib.NewReader(c.conn)
		if err != nil {
			_ = c.conn.Close()
			c.conn = nil
			continue
		}

		reader := bufio.NewReaderSize(zr, bufSize)

		for {
			err = c.readLiveFlightUpdate(ctx, reader, subscriber)
			if err != nil {
				_ = zr.Close()
				_ = c.conn.Close()
				c.conn = nil
				break
			}

			c.numberOfReads++
			if c.numberOfReads >= rotateAfterMsgs {
				c.numberOfReads = 0
				_ = zr.Close()
				_ = c.conn.Close()
				c.conn = nil

				break
			}
		}
	}
}

// readLiveFlightUpdate reads ONE line, dispatches if applicable, then returns.
// Returns nil on success; a wrapped error (incl. io.EOF) ends the current connection.
func (c *Client) readLiveFlightUpdate(ctx context.Context, reader *bufio.Reader, sub chan<- core.LiveFlightUpdate) error {
	select {
	case <-ctx.Done():
		log.Info(ctx, "Context done, terminating read loop")
		return ctx.Err()
	default:
	}

	line, err := reader.ReadString('\n')
	if err != nil {
		return errors.Wrap(err, "failed to read string from reader")
	}

	s := strings.Trim(line, "\n\t")
	s = strings.ReplaceAll(s, "\t", "")

	var msg RealtimeFlightData
	if err := json.Unmarshal([]byte(s), &msg); err != nil {
		log.Debug(ctx, "Initial unmarshal failed, sanitizing", zap.Error(err), zap.String("message", s))
		safe := fixInvalidEscapes(s)
		if err2 := json.Unmarshal([]byte(safe), &msg); err2 != nil {
			log.Warn(ctx, "Failed to unmarshal even after sanitizing", zap.Error(err2), zap.String("message", safe))
			return nil // skip bad line; keep connection
		}
	}

	if msg.HasLiveFlightID() {
		sub <- msg.toDomain()
	}

	return nil
}

var invalidEscape = regexp.MustCompile(`\\[^"\\/bfnrtu]`)

func fixInvalidEscapes(s string) string {
	return invalidEscape.ReplaceAllStringFunc(s, func(m string) string { return m[1:] })
}

func (c *Client) Close() error {
	if c.conn != nil {
		_ = c.conn.Close()
		c.conn = nil
	}
	if c.sshc != nil {
		_ = c.sshc.Close()
		c.sshc = nil
	}
	return nil
}

type metrics struct {
	sshResets      int
	lastSSHReset   time.Time
	lastSuccessful time.Time
	lastLog        time.Time
	interval       time.Duration
}

func newMetrics(interval time.Duration) *metrics {
	return &metrics{lastLog: time.Now(), interval: interval}
}

func (m *metrics) incrementSSHReset()       { m.sshResets++; m.lastSSHReset = time.Now() }
func (m *metrics) recordSuccessfulConnect() { m.lastSuccessful = time.Now() }
func (m *metrics) reset()                   { m.sshResets = 0; m.lastLog = time.Now() }

func (m *metrics) logIfNeeded(ctx context.Context) {
	now := time.Now()
	if now.Sub(m.lastLog) < m.interval || m.sshResets == 0 {
		return
	}
	dur := now.Sub(m.lastLog)
	avg := float64(m.sshResets) / dur.Minutes()

	log.Debug(ctx, "RadarBox SSH reset stats",
		zap.String("last_log", m.lastLog.UTC().Format(time.RFC3339)),
		zap.String("last_successful_connect", m.lastSuccessful.UTC().Format(time.RFC3339)),
		zap.String("last_ssh_reset", m.lastSSHReset.UTC().Format(time.RFC3339)),
		zap.Int("ssh_resets", m.sshResets),
		zap.Float64("avg_ssh_resets_per_min", avg),
	)

	m.reset()
}

