type coordinateText string

func (c coordinateText) Parse() (*core.Coordinate, error) {
	pieces := strings.Split(string(c), ",")
	if len(pieces) != 2 {
		return nil, errors.New("invalid value")
	}

	lat, err := strconv.ParseFloat(pieces[0], 64)
	if err != nil {
		return nil, errors.Wrap(err, "invalid latitude value")
	}

	lon, err := strconv.ParseFloat(pieces[1], 64)
	if err != nil {
		return nil, errors.Wrap(err, "invalid longitude value")
	}

	return &core.Coordinate{
		Lat: lat,
		Lon: lon,
	}, nil
}

type withinRequest struct {
	TopLeft     coordinateText `form:"filter[bb][top_left]" binding:"required,omitempty,coord"`
	BottomRight coordinateText `form:"filter[bb][bottom_right]" binding:"required,omitempty,coord"`

	// Classification integer value of airline classification, 1-5
	// If + is provided, it will return all airline with classification greater than or equal to, e.g. 2+
	// if - is provided, it will return all airline with classification less than or equal to. e.g. 3-
	AirlineClassification string `form:"filter[airline_classification]" binding:"omitempty,classification"`
}

func (h *Handler) within(c *gin.Context) {
	var req withinRequest
	if err := c.ShouldBindQuery(&req); err != nil {
		log.Error(c, "failed to bind request query", zap.Error(err))
		_ = c.Error(errRequestBindingFailed)
		return
	}

	bb, err := req.GetWithinBoundingBox()
	if err != nil {
		log.Error(c, "failed to extract bounding box", zap.Error(err))
		_ = c.Error(errInvalidWithinBoundingBox)
		return
	}

	cl, err := parseClassifiction(req.AirlineClassification)
	if err != nil {
		log.Error(c, "failed to parse classification",
			zap.String("classification", req.AirlineClassification),
			zap.Error(err),
		)

		_ = c.Error(errInvalidClassification)
		return
	}

	flights, err := h.svc.FilterLiveFlights(c, &core.FlightsWithin{
		BoundingBox:           bb,
		MaxAge:                15 * time.Minute,
		AirlineClassification: cl,
	})
	if err != nil {
		log.Error(c, "failed to find flights within bounding box", zap.Error(err))
		_ = c.Error(err)
		return
	}

	res := make([]*liveFlightWithin, 0, len(flights))
	for _, ap := range flights {
		res = append(res, liveFlightWithinFromDomain(ap))
	}

	c.PureJSON(http.StatusOK, xhttp.NewResponse(
		res,
		"ok",
		"Here are the flights within the bounding box.",
	))
}

func (r withinRequest) GetWithinBoundingBox() (*core.BoundingBox, error) {
	if string(r.BottomRight) == "" || string(r.TopLeft) == "" {
		return nil, nil
	}

	tl, err := r.TopLeft.Parse()
	if err != nil {
		return nil, err
	}

	br, err := r.BottomRight.Parse()
	if err != nil {
		return nil, err
	}

	return &core.BoundingBox{
		TopLeft:     tl,
		BottomRight: br,
	}, nil
}

var classificationRe = regexp.MustCompile(`^([1-5])([+-])?$`)

func parseClassifiction(c string) (*core.Classification, error) {
	c = strings.TrimSpace(c)

	if string(c) == "" {
		return nil, nil
	}

	matches := classificationRe.FindStringSubmatch(c)

	if len(matches) != 3 {
		return nil, errors.New("wrong classification format")
	}

	var comparator core.ClassificationComparator
	switch matches[2] {
	case "+":
		comparator = core.ClassificationGreaterComparator
	case "-":
		comparator = core.ClassificationLesserComparator
	default:
		comparator = core.ClassificationEqualComparator
	}

	value, _ := strconv.Atoi(matches[1])

	return &core.Classification{
		C:          int8(value),
		Comparator: comparator,
	}, nil
}

