var (
	errRequestBindingFailed     = errors.New("request binding failed")
	errInvalidCoordinate        = errors.New("invalid coordinate")
	errInvalidWithinBoundingBox = errors.New("invalid within bounding box")
	errInvalidClassification    = errors.New("invalid classification")
	errFlightNotFound           = errors.New("flight not found")
)

func (h *Handler) handleErrors(c *gin.Context) {
	c.Next()

	if len(c.Errors) == 0 {
		return
	}

	err := c.Errors[0]

	if errors.Is(err, errInvalidCoordinate) {
		c.PureJSON(http.StatusBadRequest, xhttp.NewErrorResponse(
			"invalid_parameters",
			`Coordinate must be provided as <latitude>,<longitude>.`),
		)
	} else if errors.Is(err, errInvalidWithinBoundingBox) {
		c.PureJSON(http.StatusBadRequest, xhttp.NewErrorResponse(
			"invalid_parameters",
			"The bounding box is invalid. A valid bounding box is made by top-left and bottom-right corners."),
		)
	} else if errors.Is(err, errInvalidClassification) {
		c.PureJSON(http.StatusBadRequest, xhttp.NewErrorResponse(
			"invalid_parameters",
			`Classification value should match regex "[1-5][+-]?".`),
		)
	} else if errors.Is(err, errFlightNotFound) {
		c.JSON(http.StatusNotFound, xhttp.NewErrorResponse(
			"not_found",
			"The requested flight was not found."),
		)
	} else if errors.Is(err, errRequestBindingFailed) {
		c.PureJSON(http.StatusBadRequest, xhttp.NewErrorResponse(
			"invalid_parameters",
			"The provided parameters are invalid."),
		)
	} else {
		c.PureJSON(http.StatusInternalServerError, xhttp.NewErrorResponse(
			"internal_error",
			"Something went wrong, please try again later."),
		)
	}

	log.Error(c, "http request failed with an error", zap.Error(err), zap.String("path", c.FullPath()))
}

