type DB struct {
	cfg Config

	*mongo.Client
}

// Connect connects to the MongoDB database. It returns a new DB instance.
func Connect(ctx context.Context, cfg Config) (*DB, error) {
	client, err := mongo.Connect(ctx, options.Client().ApplyURI(cfg.dns()))
	if err != nil {
		return nil, err
	}

	return &DB{
		cfg:    cfg,
		Client: client,
	}, nil
}

type Config struct {
	User       string `mapstructure:"user"`
	Password   string `mapstructure:"password"`
	Host       string `mapstructure:"host"`
	Port       int    `mapstructure:"port"`
	DB         string `mapstructure:"name"`
	ReplicaSet string `mapstructure:"replica-set"`
	URI        string `mapstructure:"uri"`
}

func (c *Config) dns() string {
	if c.URI != "" {
		return c.URI
	}

	var credentials string

	if c.User != "" && c.Password != "" {
		credentials = fmt.Sprintf("%s:%s@", c.User, c.Password)
	}

	query := []string{
		"authSource=admin",
	}
	if c.ReplicaSet != "" {
		query = append(query,
			"replicaSet="+c.ReplicaSet,
			"readPreference=secondaryPreferred",
			"retryWrites=false",
		)
	}

	return fmt.Sprintf(
		"mongodb://%s%s:%d/%s?%s",
		credentials,
		c.Host,
		c.Port,
		c.DB,
		strings.Join(query, "&"),
	)
}

