	"go.mongodb.org/mongo-driver/mongo"
)

//go:embed migrations/*.json
var migrationsfs embed.FS

// Migrate runs the database migrations.
func Migrate(ctx context.Context, dbName string, client *mongo.Client) error {
	sourceDriver, err := iofs.New(migrationsfs, "migrations")
	if err != nil {
		return errors.Wrap(err, "failed to create migrations source driver")
	}

	dbDriver, err := mongodb.WithInstance(client, &mongodb.Config{
		DatabaseName: dbName,
	})
	if err != nil {
		return errors.Wrap(err, "failed to create database driver")
	}

	migrator, err := migrate.NewWithInstance("iofs", sourceDriver, dbName, dbDriver)
	if err != nil {
		return errors.Wrap(err, "failed to create migrator")
	}

	if err = migrator.Up(); err != nil && !errors.Is(err, migrate.ErrNoChange) {
		return errors.Wrap(err, "failed to migrate up")
	}

	return nil
}

